import React from 'react';
import classes from './css/offers.module.css';
import discount_icons from './img/discount.png';
import speed_icons from './img/speed.png';
import all_in_icons from './img/all_in.png'
import dox_icons from './img/doc.png';
import guarantee_icons from './img/guarantee.png';
import approach_icons from './img/approach.png';

const Offers=(props)=>{
    return <div className={classes.main_block}>
            <div className={classes.header}>
                <h3>Что мы предлагаем для пользователей</h3>
            </div>
        <div className={classes.block_information}>
            <div className={classes.line}>
                <div className={classes.column}>
                    {/*<div className={classes.block_img}>*/}
                    {/*    <img src={discount_icons}/>*/}
                    {/*</div>*/}
                    <div className={classes.title}>
                        <h3>
                            Экономия
                        </h3>
                    </div>
                    <div className={classes.block_text}>
                        <p>
                            Заказывать через нас дешевле чем у самой транспортной компании до 50%
                        </p>
                    </div>
                </div>
                <div className={classes.column}>
                    {/*<div className={classes.block_img}>*/}
                    {/*    <img src={speed_icons}/>*/}
                    {/*</div>*/}
                    <div className={classes.title}>
                        <h3>
                            Скорость
                        </h3>
                    </div>
                    <div className={classes.block_text}>
                        <p>
                            Оформить заявку на доставку можно всего за 2 минуты
                        </p>
                    </div>
                </div>
                <div className={classes.column}>
                    <div className={classes.block_img}>
                        <img src={all_in_icons}/>
                    </div>
                    <div className={classes.title}>
                        <h3>
                            Все в одном месте
                        </h3>
                    </div>
                    <div className={classes.block_text}>
                        <p>
                            Все перевозчики на одной площадке. Больше не нужно заходить на множество сайтов и сравнивать цены. Экономия вашего времени для нас в приоритете
                        </p>
                    </div>
                </div>
            </div>
            {/*<div className={classes.line}>*/}
            {/*    <div className={classes.column}>*/}
            {/*        <div className={classes.block_img}>*/}
            {/*            <img src={dox_icons}/>*/}
            {/*        </div>*/}
            {/*        <div className={classes.title}>*/}
            {/*            <h3>*/}
            {/*                Всего один документ*/}
            {/*            </h3>*/}
            {/*        </div>*/}
            {/*        <div className={classes.block_text}>*/}
            {/*            <p>*/}
            {/*                Теперь работать со всеми грузоперевозчиками можно получив лишь один договор*/}
            {/*            </p>*/}
            {/*        </div>*/}
            {/*    </div>*/}
            {/*    <div className={classes.column}>*/}
            {/*        <div className={classes.block_img}>*/}
            {/*            <img src={guarantee_icons}/>*/}
            {/*        </div>*/}
            {/*        <div className={classes.title}>*/}
            {/*            <h3>*/}
            {/*                Гарантия*/}
            {/*            </h3>*/}
            {/*        </div>*/}
            {/*        <div className={classes.block_text}>*/}
            {/*            <p>*/}
            {/*                Если ваше отправление потеряется, мы найдём его*/}
            {/*            </p>*/}
            {/*        </div>*/}
            {/*    </div>*/}
            {/*    <div className={classes.column}>*/}
            {/*        <div className={classes.block_img}>*/}
            {/*            <img src={approach_icons}/>*/}
            {/*        </div>*/}
            {/*        <div className={classes.title}>*/}
            {/*            <h3>*/}
            {/*                Индивидуальный подход*/}
            {/*            </h3>*/}
            {/*        </div>*/}
            {/*        <div className={classes.block_text}>*/}
            {/*            <p>*/}
            {/*                Мы всегда на связи со своими клиентами, круглосуточная поддержка 24/7*/}
            {/*            </p>*/}
            {/*        </div>*/}
            {/*    </div>*/}
            {/*</div>*/}
        </div>
    </div>
}
export default Offers;
